GLOBAL(boolean)
keymatch(char *arg, const char *keyword, int minchars)
{
  register int ca, ck;
  register int nmatched = 0;

  while ((ca = *arg++) != '\0') {
    if ((ck = *keyword++) == '\0')
      return FALSE;             
    if (isupper(ca))            
      ca = tolower(ca);
    if (ca != ck)
      return FALSE;             
    nmatched++;                 
  }

  if (nmatched < minchars)
    return FALSE;
  return TRUE;                  
}

