{
    if (minor_status)
	*minor_status = 0;



    if(buffer == GSS_C_NO_BUFFER)
	return(GSS_S_COMPLETE);

    if ((buffer->length) &&
	(buffer->value)) {
	    gssalloc_free(buffer->value);
	    buffer->length = 0;
	    buffer->value = NULL;
    }

    return (GSS_S_COMPLETE);
}

